import React, { useState } from 'react';

const LoginBox = () => {
  // State to manage form input
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();
    // Add your login logic here
    console.log('Username:', username);
    console.log('Password:', password);
  };

  return (
    <div
      className="login-box"
      id="login-box"
      style={{
        backgroundColor: 'rgba(255, 255, 255, 0.9)',
        width: '600px',
        padding: '40px',
        borderRadius: '10px',
        margin: 'auto',
        boxShadow: '0 0 10px rgba(0, 0, 0, 0.1)',
      }}
    >
      <h1 style={{ textAlign: 'center', marginBottom: '10px', fontSize: '24px', color: '#333' }}>
        Welcome to Leornado
      </h1>
      <h2 style={{ textAlign: 'center', marginBottom: '20px', fontSize: '18px', color: '#333' }}>
        CUSTOMER LOGIN
      </h2>
      <form id="login-form" onSubmit={handleSubmit}>
        <label htmlFor="username" style={{ marginBottom: '5px', fontSize: '14px', color: '#333' }}>
          Username
        </label>
        <input
          type="text"
          id="username"
          placeholder="Type Your Username"
          required
          style={{
            border: 'none',
            backgroundColor: '#f4f4f4',
            padding: '15px',
            marginBottom: '15px',
            borderRadius: '5px',
            fontSize: '14px',
            width: '100%',
          }}
          value={username}
          onChange={(e) => setUsername(e.target.value)}
        />

        <label htmlFor="password" style={{ marginBottom: '5px', fontSize: '14px', color: '#333' }}>
          Password
        </label>
        <input
          type="password"
          id="password"
          placeholder="Type Your Password"
          required
          style={{
            border: 'none',
            backgroundColor: '#f4f4f4',
            padding: '15px',
            marginBottom: '15px',
            borderRadius: '5px',
            fontSize: '14px',
            width: '100%',
          }}
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />

        <input
          type="submit"
          value="LOGIN"
          style={{
            backgroundColor: '#c0392b',
            color: 'white',
            cursor: 'pointer',
            fontSize: '16px',
            padding: '15px',
            border: 'none',
            borderRadius: '5px',
            width: '100%',
          }}
        />
      </form>
      <div
        className="links"
        style={{
          display: 'flex',
          justifyContent: 'space-between',
          fontSize: '12px',
          marginTop: '15px',
        }}
      >
        <a href="#" style={{ color: '#333', textDecoration: 'none' }}>
          Forgot Password?
        </a>
        <a href="#" id="show-register" style={{ color: '#333', textDecoration: 'none' }}>
          Register
        </a>
      </div>
    </div>
  );
};

export default LoginBox;
